import React from 'react';
import '../index.css'

function Upload(){
    const handleClick = event =>{
        hiddenFileInput.current.click();
    }
    return(
        <div class="Upload">
            <button onClick={handleClick}>Escolha uma imagem</button>
            <input type="file" class="inputfile" />
        </div>
    );
}

export default Upload;
